import React from 'react';

function Performance() {
  // Sample data for subjects and performance
  const subjects = [
    { name: 'Mathematics', marks: 85 },
    { name: 'Physics', marks: 90 },
    { name: 'Chemistry', marks: 78 },
    { name: 'Computer Science', marks: 92 },
    { name: 'Electrical Engineering', marks: 88 },
    { name: 'Mechanical Engineering', marks: 80 },
  ];

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '20px', color: '#007BFF' }}>
        Student Performance
      </h1>

      <div style={{ marginBottom: '30px' }}>
        <h2 style={{ color: '#333', fontSize: '20px' }}>Engineering Subjects</h2>
        <ul style={{ listStyleType: 'none', padding: '0' }}>
          {subjects.map((subject, index) => (
            <li
              key={index}
              style={{
                padding: '10px',
                margin: '10px 0',
                border: '1px solid #ddd',
                borderRadius: '8px',
                backgroundColor: '#f9f9f9',
                display: 'flex',
                justifyContent: 'space-between',
              }}
            >
              <span style={{ fontWeight: 'bold' }}>{subject.name}</span>
              <span>{subject.marks}%</span>
            </li>
          ))}
        </ul>
      </div>

      <div style={{ textAlign: 'center' }}>
        <h3 style={{ color: '#007BFF' }}>Overall Performance</h3>
        <p style={{ fontSize: '18px', color: '#333' }}>
          Based on the performance in various subjects, the student is performing well, with an overall average of{' '}
          {(
            subjects.reduce((acc, subject) => acc + subject.marks, 0) / subjects.length
          ).toFixed(2)}% in all subjects.
        </p>
      </div>
    </div>
  );
}

export default Performance;
